import React from 'react'

export default function FilterSection() {
  return (
    <div>
        <form>
              <input type='text' name='search' placeholder='Search your product' id='input'/>
              <input type='submit' name='submit' value='Search' id='submit'/>
        </form>
    </div>
  )
}
